import { render } from '@testing-library/react';
import React, {Component, Fragment} from 'react'; 
import fondoLogin from "../assets/img/fondoLogin.jpg"
import '../assets/css/Perfil.css';

const eliminarUsuario = async()=>
{
  sessionStorage.removeItem('usuarioActivo')
  //alert("di clic")
}


class Perfil  extends Component{
render(){

    let usuario =JSON.parse(sessionStorage.getItem('usuarioActivo'));
 
    return(
    <Fragment>
    <div className="">
      <img src={fondoLogin} className="fondoLogin"/>
    </div>

    <div className="container-fluid">
      <div className="row align-items-center justify-content-center center-block minh-100 ">

       <div className="col-xs-6 col-sm-8  col-md-8 col-lg-4 ">
     
            <div className="card text-white bg-secondary">
                <div className="card-header text-center ">   
                     <h1 className="card-title">Perfil</h1>  
                </div>         
            <div className="card-body">
                <div className="input-group mb-3">
                   <div className="input-group-prepend">

                   <h3>
                    Identificación:{usuario.map(usuario => <div>{usuario.identificacion}</div>)}    
                   </h3>
                   
                   <h3>
                    Correo:{usuario.map(usuario => <div>{usuario.correo}</div>)}    
                   </h3>

                   <h3>
                    Nombres:{usuario.map(usuario => <div>{usuario.nombres}</div>)}    
                   </h3>

                   <h3>
                    Apellidos:{usuario.map(usuario => <div>{usuario.apellidos}</div>)}    
                   </h3>

                   <h3>
                    rol:{usuario.map(usuario => <div>{usuario.rol}</div>)}    
                   </h3>

                   </div>   
                </div>

                <div className="input-group mb-3">
                    <div className="input-group-prepend">
                    <button onClick={eliminarUsuario}
                                className="btn btn-primary btn-lg btn-block" to="/">
                                    Cerrar Sesion
                    </button>
                    </div>
                </div>

                <div className="text-center">
               
                </div>
                </div>
            </div>

            </div>
          
        </div>
    </div>

           
            
        </Fragment>
    )
}

}export default Perfil
